-- ----------------------------
-- Procedure structure for FindAllPaths
-- ----------------------------
DROP PROCEDURE IF EXISTS `FindAllPaths`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `FindAllPaths`(`source_id` INT, `destination_id` INT)
BEGIN
    DECLARE max_depth INT DEFAULT 10; -- Maximum depth of traversal
    -- Create a table to store paths
    CREATE TABLE paths (
        id INT AUTO_INCREMENT PRIMARY KEY,
        depth INT,
        nodes TEXT
    );
    -- Insert the initial path (source device) into the table
    SELECT 0, CAST(source_id AS CHAR);
    -- Loop to find all paths using depth-first traversal
    WHILE max_depth > 0 DO
        -- Find the path with the current depth from the paths table
        SET @current_path = (SELECT nodes FROM paths WHERE depth = max_depth - 1);
        -- Find the last device in the current path
        SET @last_device = CAST(SUBSTRING_INDEX(@current_path, '->', -1) AS UNSIGNED);
        -- Insert new paths into the table
        SELECT max_depth, CONCAT(@current_path, '->', c.destination_device)
        FROM connections AS c
        WHERE c.source_device = @last_device
              AND NOT EXISTS (SELECT 1 FROM paths WHERE nodes = CONCAT(@current_path, '->', c.destination_device));
        SET max_depth = max_depth - 1;
    END WHILE;
    -- Return all paths
    SELECT nodes FROM paths
    WHERE nodes LIKE CONCAT(source_id, '%->', destination_id)
    ORDER BY nodes;
    -- Drop the paths table
    DROP TABLE IF EXISTS paths;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for FindConnectedNodes
-- ----------------------------
DROP PROCEDURE IF EXISTS `FindConnectedNodes`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `FindConnectedNodes`(`input_node_id` INT)
BEGIN
    -- Return all connected nodes
    SELECT destination_device
    FROM connections
    WHERE source_device = input_node_id;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for findShortestPaths
-- ----------------------------
DROP PROCEDURE IF EXISTS `findShortestPaths`;
delimiter ;;
CREATE DEFINER=`root`@`%` PROCEDURE `findShortestPaths`(
	in source_name VARCHAR(50),
	in target_names VARCHAR(255),
	in path_max INT,
	in enable_log INT,
	in print_path INT
)
LABEL_PROC:
BEGIN
	DECLARE source_id INT;
	DECLARE target_id INT;
	DECLARE target_name VARCHAR(50) default '';
	DECLARE temp_name VARCHAR(50);
	DECLARE target_ids VARCHAR(255) default '';
	#current
	DECLARE r_id INT;
	DECLARE n_id INT;
	DECLARE n_comulative_cost INT;
	DECLARE n_type VARCHAR(20);
	DECLARE n_depth INT;
	#child
	DECLARE c_id INT;
	DECLARE c_cost INT;
	DECLARE c_name VARCHAR(50);
	DECLARE c_type VARCHAR(20);
	#process
	DECLARE n_ids VARCHAR(255);
	DECLARE target_count INT default 0;
	DECLARE c_count INT default 0;
	DECLARE path_count INT;
	DECLARE name_cut INT default 20;
	DECLARE queue_empty INT default 0;
	DECLARE batchId INT default FLOOR(RAND()*1000000);
	#log and run time
	DECLARE log_type VARCHAR(255);
	DECLARE start_time_ms DECIMAL(15, 3);
	DECLARE end_time_ms DECIMAL(15, 3);
    #cursors
	DECLARE childNodeCur CURSOR FOR
	SELECT e.destination_device,e.weight+n.cost,n.name,n.type FROM connections e JOIN devices n ON e.destination_device = n.id WHERE e.source_device = n_id AND n.status='Operational' ORDER BY e.weight;
	# tmp table for saving data
	DROP TEMPORARY TABLE IF EXISTS temp_path_t;
	CREATE TEMPORARY TABLE temp_path_t (
			`source` VARCHAR(50) NOT NULL,
			`target` VARCHAR(50) NOT NULL,
			total_node INT NOT NULL,
			total_cost INT NOT NULL,
			path VARCHAR(1000) CHARACTER SET ascii COLLATE ascii_general_ci NOT NULL
	);

	IF enable_log!=1 THEN
		SET enable_log = 0;
	END IF;
	IF print_path!=1 THEN
		SET print_path = 0;
	END IF;
	# def log type
	SET log_type = concat('findShortestPaths(',source_name,',',target_names,',',path_max,',',enable_log,')');
	SET start_time_ms=UNIX_TIMESTAMP(NOW(6));	
	# valid check
	IF path_max<1 THEN
	LEAVE LABEL_PROC;
	END IF;
	SELECT id INTO source_id FROM devices WHERE name=source_name AND type='Source' AND status='Operational';
	IF FOUND_ROWS()=0 THEN
		LEAVE LABEL_PROC;
	END IF;
	SELECT 1 INTO @checkTmp FROM connections WHERE source_device=source_id LIMIT 1;
	IF FOUND_ROWS()=0 THEN
		LEAVE LABEL_PROC;
	END IF;
	
	# init queue for algorithm
	DELETE FROM temp_path;
	id,type,cost,0,concat(',',id,','),concat(LEFT(name, name_cut)) FROM devices WHERE id = source_id AND type='Source';
	IF enable_log THEN
	END IF;
	# loop targets
	ltarget: LOOP
		SET target_count = target_count+1;
		SELECT trim(substring_index(substring_index(target_names,',',target_count),',',-1)) INTO temp_name;
		IF target_name=temp_name THEN
			LEAVE ltarget;
		END IF;
		SET target_name = temp_name;

		IF enable_log THEN
		END IF;
		# valid check
		SELECT id INTO target_id FROM devices WHERE name=target_name AND type='Destination' AND status='Operational';
		IF FOUND_ROWS()=0 THEN
			ITERATE ltarget;
		END IF;
		SELECT 1 INTO @checkTmp FROM connections WHERE destination_device=target_id LIMIT 1;
		IF FOUND_ROWS()=0 THEN
			ITERATE ltarget;
		END IF;

		# skip duplicated target
		IF locate(concat(',',target_id,','),concat(target_ids,',')) THEN
			ITERATE ltarget;
		END IF;
		# init
		SET target_ids=concat(target_ids, ',',target_id);
		SELECT COUNT(*) INTO path_count FROM temp_path WHERE current_node_id=target_id AND finish=1 ORDER BY comulative_cost ASC, depth ASC LIMIT path_max;
		IF path_count<path_max AND NOT queue_empty THEN
			que:LOOP
				# dequeue
				SELECT id,current_node_id,comulative_cost,type,depth,node_ids 
				INTO r_id,n_id,n_comulative_cost,n_type,n_depth,n_ids 
				FROM temp_path WHERE finish=0 ORDER BY comulative_cost ASC,depth ASC LIMIT 1;
				# finished the entire graph seaching
				IF FOUND_ROWS()=0 THEN
					SET queue_empty = 1;
					LEAVE que;
				END IF;
				IF enable_log THEN
				END IF;	
				# achieve the target				
				IF n_id=target_id THEN
					SET path_count=path_count+1;
					IF enable_log THEN
					END IF;
					UPDATE temp_path SET finish=1 WHERE id=r_id;
					
					IF path_count=path_max THEN
						LEAVE que;
					ELSE
						ITERATE que;
					END IF;
				END IF;

				# achieve the end of a path
				SELECT COUNT(*) INTO c_count FROM connections e JOIN devices n ON e.destination_device = n.id WHERE e.source_device = n_id AND n.status='Operational';
				IF c_count=0 THEN
					UPDATE temp_path SET finish=1 WHERE current_node_id=n_id;
				# normal case
				ELSE
					# loop children nodes
					OPEN childNodeCur;
					cnr:LOOP
						# children nodes have been expanded
						IF c_count=0 THEN
							# cycle happened at the last loop
							IF NOT @updatedPath THEN
								UPDATE temp_path SET finish=1 WHERE id=r_id;
							END IF;
							LEAVE cnr;
						END IF;
						FETCH childNodeCur INTO c_id, c_cost, c_name, c_type;
						# check cycle
						IF locate(concat(',',c_id,','),n_ids) THEN
							SET c_count=c_count-1;
							IF enable_log THEN
							END IF;
							ITERATE cnr;
						END IF;
						IF enable_log THEN
						END IF;
						# update for the last child
						IF c_count=1 THEN
							SET @updatedPath=TRUE;
							UPDATE temp_path SET current_node_id=c_id,type=c_type,comulative_cost=comulative_cost+c_cost,depth=depth+1,
							node_ids=concat(node_ids,c_id,','),node_names=concat(node_names,'->',LEFT(c_name, name_cut))
							WHERE current_node_id=n_id;
						# insert for the first n-1 children
						ELSE
							SELECT c_id,c_type,comulative_cost+c_cost,depth+1,concat(node_ids,c_id,','),concat(node_names,'->',LEFT(c_name, name_cut))
							FROM temp_path WHERE current_node_id=n_id;
						END IF;
						SET c_count=c_count-1;
					END LOOP cnr;
					CLOSE childNodeCur;
				END IF;
			END LOOP que;
		END IF;
		IF enable_log THEN
		END IF;
		#save path
	END LOOP ltarget;  
		#save path
	batchId,source,target,total_cost,total_node,path,'findShortestPaths' FROM temp_path_t;
	# show data
	IF print_path THEN
		SELECT @row_num:=@row_num+1 AS '#',batchId as 'BatchId',source as 'Source',target as 'Destination',path as 'Path',total_node as 'NodeCount',total_cost as 'TotalCost' FROM temp_path_t t,(SELECT @row_num := 0) r;
	END IF;
	SET end_time_ms=UNIX_TIMESTAMP(NOW(6));
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for showShortestCombines
-- ----------------------------
DROP PROCEDURE IF EXISTS `showShortestCombines`;
delimiter ;;
CREATE DEFINER=`root`@`%` PROCEDURE `showShortestCombines`(
	in batchId INT
)
LABEL_PROC:
BEGIN
	SELECT combine_number AS '#',path AS 'SubPath',path_cost AS 'SubPathCost',combine_cost AS 'OverallCost' FROM combination WHERE batch_id=batchId;
END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
